import React, { Component } from "react";
import { Grid, Cell } from 'react-mdl';

class Landing extends Component {
	render(){
		return (

			<div style = {{width: '100%', margin: 'auto'}}> <h1> Landing page </h1> 
				<Grid classname="landing-grid">
					<Cell col={12}> </Cell>
				</Grid>

			</div>
			)

	};
}

export default Landing;
